--
-- Table structure for table `admissions`
--

DROP TABLE IF EXISTS `admissions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `admissions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `fullname` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `gender` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `politicalstatus` int(11) NOT NULL,
  `idtype` int(11) NOT NULL,
  `idnumber` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `dateofbirth` date NOT NULL,
  `nationgroup` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `occupation` int(11) NOT NULL,
  `maritalstatus` int(11) NOT NULL,
  `hukou` int(11) NOT NULL,
  `jiguan` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `hometown` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mobile` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `phone` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address` text COLLATE utf8_unicode_ci,
  `postcode` int(11) DEFAULT NULL,
  `program` int(11) NOT NULL,
  `programcode` int(11) NOT NULL,
  `campuscode` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `admissionid` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `enrollmenttype` smallint(6) DEFAULT NULL,
  `studentno` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `admissionyear` smallint(6) DEFAULT NULL,
  `admissionsemester` varchar(3) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ksh` varchar(17) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `admissions_id_index` (`id`),
  KEY `admissions_user_id_index` (`user_id`),
  CONSTRAINT `admissions_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=317 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

